import React, { useEffect } from "react";
import { FaGithub } from "react-icons/fa";

import '../styles/AboutUs.css';

const AboutUs = () => {
  useEffect(() => {
    const style = document.createElement("style");
    style.innerHTML = `/* styles same as above */`;
    document.head.appendChild(style);
    return () => document.head.removeChild(style);
  }, []);

  const teamMembers = [
    {
      name: "Tejas Nikumbh",
      role: "Frontend Developer",
      img: "https://via.placeholder.com/600x500?text=Tejas",
      desc: "Tejas is responsible for creating the user interface and ensuring a smooth user experience.",
      github: "https://github.com/tejasnikumbh"
    },
    {
      name: "Utsav",
      role: "Backend Developer",
      img: "https://via.placeholder.com/600x500?text=Utsav",
      desc: "Utsav handles server-side logic and database integration, ensuring performance and security.",
      github: "https://github.com/utsav"
    },
    {
      name: "Yash",
      role: "Product Manager",
      img: "https://via.placeholder.com/600x500?text=Yash",
      desc: "Yash ensures that product vision aligns with user needs and oversees timely project delivery.",
      github: "https://github.com/yash"
    },
  ];

  return (
    <div className="about-container">
      <h1 className="about-title">About Us</h1>
      <div className="team-grid">
        {teamMembers.map((member, index) => (
          <div
            className="team-card"
            key={index}
            style={{ animationDelay: `${index * 0.3}s` }}
          >
            <img src={member.img} alt={member.name} className="team-img" />
            <h3 className="team-name">{member.name}</h3>
            <p className="team-role">{member.role}</p>
            <p className="team-desc">{member.desc}</p>
            <div className="social-links">
              <a 
                href={member.github} 
                target="_blank" 
                rel="noopener noreferrer" 
                className="social-link"
              >
                <FaGithub />
              </a>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AboutUs;
